import React from "react";
import List from "../models/List.js";
export default class Data extends React.Component {
    constructor(props) {
        super(props);
        console.log(props);
    }
    render() {
        return(
            <div className="Results">
                <div className="row">
                    <div className="col-lg-12">
                        <ul class="list-group list-group-flush">
                            {this.props.data.results && <li class="list-group-item">{this.props.data.results}</li>}
                            {this.props.data.state && <li class="list-group-item">{this.props.data.state}</li>}
                            {this.props.data.date && <li class="list-group-item">{this.props.data.date}</li>}
                            {this.props.data.cases && <li class="list-group-item">{this.props.data.cases}</li>}
                            {this.props.data.deaths && <li class="list-group-item">{this.props.data.deaths}</li>}
                        </ul>
                    </div>
                </div>
                <div className = "row">
                    <List list = {this.props.data.list}/>
                </div>
            </div>
        )
    }
}
